class AnimatePocky {
  constructor(containerId = "pocky") {
    this.anim = lottie.loadAnimation({
      container: document.getElementById(containerId),
      renderer: "svg",
      loop: false,
      autoplay: false,
      animationData: getAnimationDataJSON(),      
    });
    this.anim.addEventListener("complete", ()=>{
        this.isAnimating = false;
    });
    this.isAnimating = false;
  }

  play  () {
    if (!this.isAnimating) {
      this.isAnimating = true;
      this.anim.goToAndPlay(0, true);
    }
  };
}

var anim= new AnimatePocky();

anim.play(); // 當動畫要播放時，目前設定一次撥完後再呼叫才會再撥放，中途被再撥放會直接忽略。


